import React from "react";

export const BarChartLabel = data => {
  // const i = data.index;
  const valueDay = data.data.day;
  const valueNumber = data.data.number;
  console.table(data.data)
  const x = data.x;
  const y = data.y;
  console.log(valueDay,valueNumber,x,y)
  return (
    <svg>
      {
       <text x={x + 49} y={y - 10}>
          {valueDay}
        </text>
      }
      {
        <text x={x + 350} y={y - 10}>
          {valueNumber}
        </text>
      }
    </svg>
  );

};
